sys_variable_value.value:
(function execute(inputs, outputs) {
// ... code ...
  var data_file = inputs.data_file;
  var file_id = inputs.file_sys_id;

  var replaceWhiteSpace = data_file.replace(/\n/g, '');
  var replaceTabs = replaceWhiteSpace.replace(/\t/g, '');
  var strClean = replaceTabs;

  strClean = strClean.replace(/[\n"\&\r\t\b\f]/g, '\\$&');

  outputs.data_file = strClean;
  outputs.file = file_id;

})(inputs, outputs);

